private IEnumerator<ICompositeObject> tempTargets;

private T GetCompositeObjectColumnValue<T>(IEnumerator<ICompositeObject> objectList, string columnName)
{
	ICompositeObject currentObject = objectList.Current;
	if(currentObject != null){
		currentObject.TryGetValue<T>(columnName, out T value);
		return value;
	}
	else{
		return default(T);
	}
}

private bool CompositeObjectListMoveNext(IEnumerator<ICompositeObject> objectList){
	return objectList.MoveNext();
}
